import React,{useState,useEffect} from 'react'
import '../Component/Recipe.css'
import Cards from './Cards'
import axios from 'axios'
export default function Recipe() { 
    const [Data ,setData]=useState([])

    useEffect(() => { 
                 axios.get('https://api.edamam.com/api/recipes/v2?type=public&q=egg&app_id=422bd884&app_key=58fcce59f62f9e39577bfb858bf32391')  
                  .then(response=>response.data)
                   .then(res=>{ 
                     setData(res.hits)
                    } )       


    }, [])


    return (
        <>
          <div className='row'> 
            <div>
                <div>
                    <input type="text" placeholder='Search Recipe Name' />
                </div>
            </div>
                <Cards data={Data}/> 
          </div>
        </>
    )
}
